import { creatBrowserRouter, RouterProvider } from 'react-router-dom';
import HomePage from './component/Home';

const router = creatBrowserRouter([
  { path: '/', element: <HomePage /> },
  {}
])

function App() {
  return <RouterProvider router={router} />;
}

export default App;
